import img404 from '../../assets/404.jpg';

const style404Img = {
    width: '100%',
    height: '100%'
}

const NotFound = () => {
    return (
        <div>
            <img sx={{style404Img}} src="img404" alt="404 page" />
        </div>
    )
}

export default NotFound
